import React, { Fragment } from 'react';
import Directory from "../../components/directory/directory.jsx"


import "./homepage.scss"

const HomePage = () => {
    throw Error
    return (
        <Fragment>
            <div className="homepage">
                <h1 className="name" >CRWN CLOTHING</h1>
                <Directory />
            </div>
        </Fragment>
    )
}



export default HomePage;
